import React from 'react';
// import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ul>
          <li><Link to="/">Beranda</Link></li>
          <li><Link to="/contact">kontak</Link></li>
          <li><Link to="/about">Tentang</Link></li>
        </ul>
      </header>
    </div>
  );
}

export default App;
